import React from 'react';
import SectionTitle from '../section_title/section_title';
import './education.css'

class Education extends React.Component {
  render() {
    return (
      <div className='education section-wrapper' id='education'>
        <SectionTitle sectionName='education' />
        <div>The University of Oklahoma, M.Sc. Computer Science</div>
        <div>
          <p>August 2020 - May 2021 (expected)</p>
          <p>4.00/4.00 GPA</p>
        </div>

        <div>The University of Oklahoma, B.Sc. Computer Science</div>
        <div>
          <p>August 2017 - May 2020</p>
          <p><i>summa cum laude</i></p>
          <p>Minor in Mathematics</p>
          <p>3.91/4.00 GPA</p>
        </div>

      </div>
    )
  }
}

export default Education
